def find_shortest_process_sequence(start, end, processes):
    if start != end:
        return []
    q = [(start, [])]
    visited = set()
    while q:
        (current, path) = q.pop(0)
        if current == end:
            return path
        visited.add(current)
        for process in [p for p in processes if p[1] == current]:
